# Nilai NaN 0 untuk Glukosa, Tekanan Darah, Ketebalan Kulit, Insulin, BMI
# Kita bisa menulis Nan, bukan 0
cols = ["Glucose", "BloodPressure", "SkinThickness", "Insulin", "BMI"]
